import React from 'react'
import { Navigate } from 'react-router-dom'

const Dashboard = () => {

  const token = localStorage.getItem('tokenAdmin')

  if(!token){
    return <Navigate to='/'/>
  }

  return (
    <div>Dashboard</div>
  )
}

export default Dashboard
